INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(1, 'I. Deixar de cumprir os horários estabelecidos pelo campus, sem justificativa', 1, 1);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(2, 'II. Entrar nas dependências restritas sem autorização ou provocar ruídos nas suas proximidades', 1, 1);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(3, 'III. Descumprir as normas do campus, que orientam o uso de vestuários e uniformes', 1, 1);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(4, 'IV. Descumprir as normas do campus que orientam o uso de instalações, equipamentos e serviços', 1, 1);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(5, 'V. Utilizar o telefone celular, outros equipamentos eletrônicos ou instrumentos musicais que interfiram no processo de ensino e aprendizagem', 1, 1);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(6, 'VI. Retirar-se do ambiente de aula sem autorização', 1, 1);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(7, 'VII. Deixar de comparecer à sala de aula ou laboratório em horário de atividade, estando presente no campus', 1, 1);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(8, 'VIII. Deixar de entregar comunicação aos pais e/ou responsáveis referentes a assuntos escolares', 1, 1);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(9, 'I. Desrespeitar, provocar, desacatar com palavras, atos ou gestos, qualquer pessoa da comunidade acadêmica', 1, 2);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(10, 'II. Instigar faltas coletivas', 1, 2);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(11, 'III. Organizar eventos e qualquer forma de arrecadação, de propaganda, distribuição de impressos, publicação ou divulgação em imprensa falada, escrita ou televisionada em nome da instituição, sem o consentimento da Direção-Geral', 1, 2);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(12, 'IV. Interromper ou conturbar qualquer atividade acadêmica e/ou técnica administrativas nas dependências do campus, ou fora deste, quando em visitas técnicas ou atividades complementares, representando-o', 1, 2);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(13, 'V. Distorcer e fornecer informações inverídicas quando solicitadas', 1, 2);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(14, 'VI. Omitir-se, sem justificativa, de atividades escolares no campus ou fora dele, quando estiver representando-o', 1, 2);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(15, 'VII. Fazer uso indevido de recursos tecnológicos do Instituto que venham infringir o presente Regulamento', 1, 2);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(16, 'VIII. Facilitar o acesso de pessoas estranhas às dependências do campus sem a devida identificação e autorização', 1, 2);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(17, 'IX. Entrar ou sair do campus utilizando acessos que não sejam os permitidos pelo mesmo', 1, 2);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(18, 'X. Exceder-se em manifestações enamoradas impróprias ao ambiente escolar', 1, 2);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(19, 'XI. Praticar a retirada de equipamentos, produtos e outros, de qualquer setor, sem a prévia autorização do responsável', 1, 2);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(20, 'I. Ausentar-se do campus ou de qualquer atividade em que esteja representando a Instituição sem autorização dos responsáveis legais e sem a devida identificação', 1, 3);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(21, 'II. Usar, portar, comercializar ou incentivar o uso de bebidas alcoólicas e substâncias entorpecentes dentro do campus ou em representação', 1, 3);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(22, 'III. Compartilhar e/ou utilizar qualquer tipo de material pornográfico nas dependências do IFRO', 1, 3);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(23, 'IV. Tentar ou cometer furto, roubo e receptação', 1, 3);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(24, 'V. Tentar ou agredir física ou moralmente qualquer membro da comunidade acadêmica no campus, durante o translado nos meios de transportes institucionais ou em representação', 1, 3);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(25, 'VI. Praticar atos sexuais, libidinosos e de atentado ao pudor nas dependências do campus ou em representação', 1, 3);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(26, 'VII. Causar danos em bens pertencentes ao campus ou propriedade alheia, ficando sujeito a indenização', 1, 3);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(27, 'VIII. Expor a perigo a vida ou a saúde de outrem', 1, 3);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(28, 'IX. Usar tabaco e similares nas dependências do IFRO ou em atividades externas de representação do mesmo, conforme definido em Lei', 1, 3);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(29, 'X. Organizar e participar de Jogos com finalidade de aposta', 1, 3);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(30, 'XI. Praticar ou incentivar qualquer modalidade de trote, bullying, cyberbullying ou qualquer outra forma de violência, que venha causar, direta ou indiretamente, danos físicos, psicológicos ou morais a qualquer membro da comunidade acadêmica', 1, 3);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(31, 'XII. Plagiar, total ou parcialmente, obras literárias, artísticas, científicas, técnicas ou culturais', 1, 3);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(32, 'XIII. Constranger alguém a fazer, tolerar que se faça ou deixar de fazer alguma coisa, mediante violência ou grave ameaça, e com o intuito de obter para si ou para outrem vantagem indevida', 1, 3);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(33, 'XIV. Portar ou manter sob sua guarda qualquer tipo de arma ou objeto cortante e perfurante nas dependências do IFRO ou em representação', 1, 3);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(34, 'XV. Adulterar documentos', 1, 3);
INSERT INTO `motivo` (`idMotivo`, `nome`, `servidor_idServidor`, `nivel_falta_idNivel_falta`) VALUES(35, 'XVI. Praticar, induzir ou incitar, por qualquer meio, a discriminação ou preconceito de gênero, raça, cor, etnia, religião, orientação sexual ou procedência', 1, 3);
